import React from 'react';
import './App.css';

function App() {
  return (
    <div>

      <div>
        <h3>N Y B  Clothing</h3>
      </div>

      <div className="topnav">
        <div className="dropdown">
          <button className="dropbtn">Produits
            <i className="fa fa-caret-down"></i>
          </button>
          <div className="dropdown-content">
            <a>Link 1</a>
            <a>Link 2</a>
            <a>Link 3</a>
          </div>
        </div>
        <a>Clients</a>
        <a>About us</a>
      </div>

    </div>
  );
}

export default App;
